- input: 'TEXT,F3XA,,"RE: Response to Commission''s review : Additional receipts totaling
    $11,313 were not dislcosed on the original filing because of a payroll reporting
    error.  Employees who had left the company or had discontinued their PAC contributions
    were not included on the payroll report used to file the original report.  It
    was an error and has since been fixed.  We have also made corrections to the Federal
    contributions and they should be reflected on the correct line of the Detailed
    Summary Page.   I apologize for the trouble.  We will continue to cooperate in
    any way necessary to correct our reports.  We also have complete documentation
    and bank statements available for all of our receipts and disbursements if necessary.  Thank
    you!"'
